(24, 'COMP20251016035', 'PT Sahara Fajarindo Corpora Cabang yogyakarta', 'pt.sahara.jogja@gmail.com', 'DSN. CIBUKAN RT.005/007 SUMBERADI MLATI SLEMAN\r\nYOGYAKARTA, Desa/Kelurahan Sumberadi, Kec. Mlati, Kab. Sleman,\r\nProvinsi Daerah Istimewa Yogyakarta,\r\nKode Pos: 55288', 'Sebagai penyedia tenaga kerja Indonesia terkemuka dan terpercaya, kami dengan bangga telah memfasilitasi penempatan kerja di luar negeri selama 3 dekade. Komitmen kami adalah memastikan tingkat integritas tertinggi bagi kandidat maupun perusahaan mitra kami.\r\nKami memberdayakan calon kandidat untuk memulai perjalanan karier yang memuaskan, sekaligus menyediakan tenaga kerja yang sangat berkualitas dan kondusif bagi perusahaan mitra kami. Memprioritaskan kesehatan dan keselamatan karyawan kami adalah hal yang terpenting, memungkinkan mereka untuk fokus pada pekerjaan mereka dengan ketenangan pikiran.', 'Perusahaan Penempatan Pekerja Migran Indonesia (P3MI)', '0710210031166', NULL, NULL, '081904180212', '/assets/images/company/logo/pt-sahara-fajarindo-corpora-cabang-yogyakarta-1760950058.jpg', 23, 1, '2025-10-16 04:37:29', '2025-11-11 08:00:55', '2025-11-11 08:00:55', 2, 23, NULL),
(25, 'COMP20251016037', 'PT Ifan Margatama Kantor Cabang D.I.Y', 'ptifanmargatamayogyakarta@gmail.com', 'Jl. Wates KM 5,5 Bodeh, Ambarketawang Kec. Gamping Kab Sleman, Daerah Istimewa Yogyakarta', 'We prepare prospective workers with knowledge, discipline. and high work ethic. in multiple field to be able to compete in the professional work field worldwide. ', 'Jasa Penempatan Pekerja Migran Indonesia', 'xxxxx', NULL, NULL, '02742256056', '/assets/images/company/logo/pt-ifan-margatama-kantor-cabang-d.i.y-1760661534.jpg', 24, 0, '2025-10-16 04:38:20', '2025-11-11 08:00:59', '2025-11-11 08:00:59', 2, 2, NULL),
(26, 'COMP20251016039', 'PT Lombok Putra Pratama Cabang Yogyakarta', 'email1@mail.com', 'Silahkan update', 'Silahkan update', 'Jasa Penempatan', 'xxxxx', NULL, NULL, '085888815255', '/assets/images/company/logo/pt-lombok-putra-pratama-cabang-yogyakarta-1760589547.jpg', 25, 1, '2025-10-16 04:39:07', '2025-11-11 08:01:04', '2025-11-11 08:01:04', 2, 2, NULL),
(27, 'COMP20251016041', 'PT Duta Wibawa Manda Putra', 'career.duta3@gmail.com', 'Jl Jenengan Raya No 100 Maguwoharjo, Depok, Sleman, Yogyakarta', 'PT Duta Wibawa Manda Putra memiliki izin resmi sebagai perusahaan penempatan pekerja migran Indonesia (P3MI) yang berkantor pusat di Yogyakarta. Menyediakan layanan informasi peluang kerja dan proses penempatan kerja ke luar negeri.', 'Jasa Penempatan', '9120305811525', NULL, NULL, '085600985550', '/assets/images/company/logo/pt-duta-wibawa-manda-putra-1761039086.jpg', 26, 1, '2025-10-16 08:58:10', '2025-11-11 08:01:19', '2025-11-11 08:01:19', 2, 26, NULL),
