(1, 'JOB202510170001', 'Waiter Assistant', 25, 218, 0, 50, 0, 6, 'Bulan', '2025-11-20', '<ul><li>USD 650 - 670/month salary.</li><li>192 hours/month work requirements.</li><li>Accommodation with 3 Meals Provided.</li><li>Insurance accordance to Turkish compensation policy for foreign workers.</li><li>Local transport from accommodation to the hotel provided.</li><li>6 months minimum contract up to 12 months on some great colleagues hired by the employer.</li></ul>', '<ul><li>Indonesia citizen age 18-40 years old.</li><li>12 graders (SMA/SMK) graduate but preferably with post secondary education background.</li><li>Should be able to understand basic English.</li><li>Hotel on the job training is a plus for non hotel academy graduates.</li></ul>', 'fb@ptifanmargatama.com', 203, 0, 0, 0, 0, 0, 0, 0, '2025-10-17 01:12:50', '2025-11-26 03:23:16', NULL, NULL, 24, NULL),
