(33, 'JOB202510230033', 'POOL GUARD', 13, 218, 0, 100, 0, 7, 'Bulan', '2025-11-24', '<p data-start=\"354\" data-end=\"428\"><strong data-start=\"354\" data-end=\"426\">LOWONGAN KERJA KE TURKI &ndash; POOL GUARD (PERHOTELAN)</strong></p>\r\n<p data-start=\"430\" data-end=\"708\">PT. Haena Duta Cemerlang Cabang Yogyakarta, Perusahaan Penempatan Pekerja Migran Indonesia (P3MI) resmi berizin dari pemerintah, membuka kesempatan bagi Calon Pekerja Migran Indonesia (CPMI) untuk bekerja di&nbsp;<strong data-start=\"646\" data-end=\"662\">negara Turki</strong>&nbsp;pada sektor&nbsp;<strong data-start=\"675\" data-end=\"690\">Hospitality</strong>, dengan posisi:</p>\r\n<ul data-start=\"709\" data-end=\"802\">\r\n<li data-start=\"709\" data-end=\"724\">\r\n<p data-start=\"711\" data-end=\"724\">Pool Guard</p>\r\n</li>\r\n</ul>\r\n<p>Pool Guard atau Lifeguard adalah staf hotel yang bertugas untuk mengawasi, menjaga keselamatan, dan memastikan keamanan tamu di area kolam renang.<strong data-start=\"243\" data-end=\"329\"> </strong>Mereka berperan penting dalam memberikan rasa aman bagi tamu yang menggunakan fasilitas kolam, sekaligus menjaga kebersihan dan ketertiban area tersebut.</p>\r\n<p data-start=\"804\" data-end=\"820\"><strong data-start=\"806\" data-end=\"818\">Benefit:</strong></p>\r\n<ul>\r\n<li>6 hari kerja per minggu</li>\r\n<li data-start=\"821\" data-end=\"894\">\r\n<p data-start=\"823\" data-end=\"894\">Kontrak kerja seasonal 5&ndash;8 bulan, dapat diperpanjang tergantung perusahaan</p>\r\n</li>\r\n<li>Gaji pokok mulai dari USD 550 - 700 per bulan (&plusmn;Rp 11.000.000,- per bulan)</li>\r\n<li>Lembur dan bonus tergantung daripada hotel atau user</li>\r\n<li data-start=\"895\" data-end=\"971\">\r\n<p data-start=\"897\" data-end=\"971\">Tempat tinggal, makan 2&ndash;4 kali per hari sewaktu kerja, dan transportasi disediakan</p>\r\n</li>\r\n<li data-start=\"895\" data-end=\"971\">Asuransi dalam dan luar negeri</li>\r\n<li data-start=\"1039\" data-end=\"1070\">Tiket one way</li>\r\n<li data-start=\"1071\" data-end=\"1144\">\r\n<p data-start=\"1073\" data-end=\"1144\">Kesempatan berkarier di hotel berbintang 5 dan lingkungan internasional</p>\r\n</li>\r\n<li data-start=\"1145\" data-end=\"1204\">\r\n<p data-start=\"1147\" data-end=\"1204\">Proses penempatan resmi, aman, dan berizin pemerintah</p>\r\n</li>\r\n</ul>\r\n<p data-start=\"1206\" data-end=\"1355\"><strong data-start=\"1209\" data-end=\"1238\">Penempatan resmi melalui:</strong><br data-start=\"1238\" data-end=\"1241\">PT. Haena Duta Cemerlang Cabang Yogyakarta<br data-start=\"1287\" data-end=\"1290\">Jl. Jogja&ndash;Solo Km. 11, Mangunan, Kalitirto, Berbah, Sleman, DIY</p>\r\n<p data-start=\"1357\" data-end=\"1568\"><strong data-start=\"1360\" data-end=\"1388\">Informasi &amp; pendaftaran:</strong><br data-start=\"1388\" data-end=\"1391\">Hubungi kami di +62 822-4193-9196 (Admin) / +62 877-3835-7476 (Pak Ari) atau datang langsung ke kantor kami.<br data-start=\"1458\" data-end=\"1461\"><strong data-start=\"1463\" data-end=\"1561\">Raih pengalaman kerja internasional di dunia perhotelan &ndash; bersama kami menuju sukses di Turki!</strong></p>', '<ul>\r\n<li>Laki - laki</li>\r\n<li>Wajib bisa berenang</li>\r\n<li>Umur 18 - 44 tahun</li>\r\n<li>Dokumen data diri lengkap</li>\r\n<li>Basic english</li>\r\n</ul>', 'hdcy88@gmail.com', 124, 0, 0, 0, 0, 0, 0, 0, '2025-10-23 09:28:19', '2025-11-26 03:23:16', NULL, 17, NULL, NULL),
(34, 'JOB202510300034', 'Laundry Attendant', 11, 54, 0, 16, 12, 6, 'Bulan', '2025-12-31', '<p>Laundry Attendant</p>\r\n<p class=\"MsoNormal\">Benefit :</p>\r\n<ul>\r\n<li class=\"MsoNormal\">Seasonal contract (5-7 months)</li>\r\n<li>Salary start from 750 Euro</li>\r\n<li class=\"MsoNormal\">Accommodation and meals provided</li>\r\n<li class=\"MsoNormal\">Flight ticket covered</li>\r\n<li class=\"MsoNormal\">Health insurance during the contract period</li>\r\n<li class=\"MsoNormal\">Working hours : 48h/week</li>\r\n</ul>', '<ul>\r\n<li class=\"MsoNormal\">Male (16)/ Female (12)</li>\r\n<li class=\"MsoNormal\">21 - 35 years old</li>\r\n<li class=\"MsoNormal\">No visible tattoo</li>\r\n<li class=\"MsoNormal\">Physically fit</li>\r\n<li class=\"MsoNormal\">Strong communication in English</li>\r\n<li class=\"MsoNormal\">Min 1 year experience in related position in 4 star or 5 star hotel</li>\r\n</ul>', 'yogya@ctiyogya.com', 8, 0, 0, 0, 0, 0, 0, 1, '2025-10-30 00:59:32', '2026-01-23 08:28:17', NULL, 15, NULL, NULL),
(35, 'JOB202510300035', 'Room Steward', 11, 54, 0, 27, 22, 6, 'Bulan', '2025-12-31', '<ul>\r\n<li class=\"MsoNormal\">Seasonal contract (5-7 months)</li>\r\n<li>Salary start from 750 Euro</li>\r\n<li class=\"MsoNormal\">Accommodation and meals provided</li>\r\n<li class=\"MsoNormal\">Flight ticket covered</li>\r\n<li class=\"MsoNormal\">Health insurance during the contract period</li>\r\n<li class=\"MsoNormal\">Working hours : 48h/week</li>\r\n</ul>', '<ul>\r\n<li class=\"MsoNormal\">Male (27)/ Female (22)</li>\r\n<li class=\"MsoNormal\">21 - 35 years old</li>\r\n<li class=\"MsoNormal\">No visible tattoo</li>\r\n<li class=\"MsoNormal\">Physically fit</li>\r\n<li class=\"MsoNormal\">Strong communication in English</li>\r\n<li class=\"MsoNormal\">Min 1 year experience in related position in 4 star or 5 star hotel</li>\r\n</ul>', 'yogya@ctiyogya.com', 14, 0, 0, 0, 0, 0, 0, 1, '2025-10-30 01:07:00', '2025-12-01 08:03:34', NULL, 15, NULL, NULL),
(36, 'JOB202510310036', 'Housekeeping', 20, 218, 50, 0, 0, 8, 'Bulan', '2025-11-20', '<p><strong>Benefit :&nbsp;</strong></p>\r\n<ol>\r\n<li>Kontrak kerja seasonal (5 - 8 bulan)</li>\r\n<li>Akomodasi gratis selama penempatan (tempat tinggal, transportasi pulang pergi kerja, dan makan 2 - 3 kali sehari)</li>\r\n<li>Gaji pokok mulai dari USD 550 (belum termauk lembur)</li>\r\n<li>Sistem kerja 6+1 (libur 1 hari dalam 1 minggu)</li>\r\n<li>Mendapatkan two way tickets</li>\r\n<li style=\"text-align: left;\">Kesempatan awal karir international</li>\r\n</ol>\r\n<p><strong>Alamat :&nbsp;</strong></p>\r\n<p>PT. Jafa Indo Corpora Yogyakarta</p>\r\n<p>Jl. Ring Road Utara No.8, Kembang, Maguwoharjo, Kec. Depok, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55281</p>\r\n<p><strong>Informasi :</strong></p>\r\n<p>+62 821-2021-6607 (admin)&nbsp;</p>', '<ol>\r\n<li>Lulusan SMA/SMK</li>\r\n<li>Memiliki pengalaman kerja minimal 6 bulan sesuai bidang (dibuktikan dengan sertifikat kerja)</li>\r\n<li>Usia 18 - 45 tahun&nbsp;</li>\r\n<li>Basic english&nbsp;</li>\r\n<li>Tidak buta warna dan tidak memiliki penyakit menular</li>\r\n</ol>', 'recruitment@jicyogyakarta.com', 0, 0, 0, 0, 0, 0, 0, 0, '2025-10-31 07:23:23', '2025-11-26 03:23:16', '2025-10-31 10:12:45', 19, 19, NULL),
